import './card.css';

const Card = ({id, email, name}) => (

   <div className="card-container" key={id}>
      <img alt={`monster ${name}`}
           src={`https://robohash.org/${id}?set=set4&size=180x180`}/>
      <h2>{name}</h2>
      <p>{email}</p>
   </div>


);

export default Card;
